import React from 'react';
import {link, withRouter} from 'react-router-dom';

import styles from './Navbar.module.css';

function Navbar() {
    return (
        <div className={styles.Navbar}>
            <link to="/">Task1</link>
        </div>
    );
}

export default withRouter(Navbar);
